import React, {useState} from 'react';
import './App.css';
import './App.scss';
import './Main.scss';
import Header from '../components/Header/Header';

function App() {

  const initState = useState({
    total: 0.00,
    a: "aaa"
  });

  console.log(initState.total[0]);

  return (
    <div className="App">
      <Header totalprice={initState.total}/>
      <h1>MAIN SITE</h1>
    </div>
  );
}

export default App;
